using System;

public class Solution {
    public int MinOperations(int[] nums1, int[] nums2) {
        int n = nums1.Length;
        int maxNums1 = nums1[0];
        int maxNums2 = nums2[0];
        int swapCount = 0;

        // Find the maximum value in both arrays
        for (int i = 1; i < n; i++) {
            if (nums1[i] > maxNums1) {
                maxNums1 = nums1[i];
            }
            if (nums2[i] > maxNums2) {
                maxNums2 = nums2[i];
            }
        }

        // Check if the last elements are already the maximum
        if (nums1[n - 1] == maxNums1 && nums2[n - 1] == maxNums2) {
            return 0;
        }

        // Check if swapping is required and possible
        if (nums1[n - 1] != maxNums1 && nums2[n - 1] != maxNums2) {
            // Check if swapping the last elements makes both conditions true
            if ((nums1[n - 1] == maxNums2 && nums2[n - 1] == maxNums1) || (nums1[n - 1] < maxNums2 && nums2[n - 1] < maxNums1)) {
                return 1;
            }

            for (int i = 0; i < n - 1; i++) {
                if ((nums1[i] == maxNums2 && nums2[i] == maxNums1) || (nums1[i] < maxNums1 && nums2[i] > maxNums2) || (nums2[i] < maxNums2 && nums1[i] > maxNums1)) {
                    swapCount++;
                    int temp = nums1[i];
                    nums1[i] = nums2[i];
                    nums2[i] = temp;
                    if ((nums1[n - 1] >= maxNums1 && nums2[n - 1] >= maxNums2) || (i == n - 2)) {
                        return swapCount;
                    }
                }
            }

            return -1;
        }

        // If only one condition is not met and cannot be resolved by swapping
        return -1;
    }
}
